def calculate_label(prediction):
    threshold = 0.5
    if prediction > threshold:
        return 'depressive'
    else:
        return 'netural'


@app.route('/')
def welcome():
    return 'Welcome to the Depflow API!'


@app.route('/predict', methods=['GET', 'POST'])
def predict():
    data = request.json
    userid = data['user']['userid']
    posts = data['posts']

    if len(posts) == 0:
        return jsonify([])
    else:
        if userid != '':
            post_ids = [id['post_id'] for id in posts]
            sentences = [post['post_value'] for post in posts]

            sequences = [preprocess_text(sentence) for sentence in sentences]
            input_data = np.array(sequences)
            predictions = model.predict(input_data)
            labels = [calculate_label(prediction) for prediction in predictions]

            result_set = []

            for i in range(len(sentences)):
                result_set.append({'post_id': post_ids[i], 'post_label': labels[i]})

            return jsonify(result_set)
        else:
            return jsonify([])


